import Header from "./components/Header";
import List from "./components/List";
import { useState } from "react";

function App() {
  const [movies, setMovies] = useState([
    {
      id: 1,
      name: "Shawshank Redemption",
      priority: true,
    },
    {
      id: 2,
      name: "The Dark Knight",
      priority: true,
    },
    {
      id: 3,
      name: "Fight Club",
      priority: false,
    },
  ]);

  return (
    <div>
      <Header user="Arnob" />
      <List movies={movies} />
    </div>
  );
}

export default App;
